import React from 'react';
import AppNavbar from '../AppNavbar/AppNavBar';
import Footer from '../Footer/Footer';

import { Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';

class cityOptions extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data : {
                "1": "1",
                "2": "2",
                "3": "3",
                "4": "4"
            }
        }
    }

    render() {
        return(
            <div>
                <AppNavbar/>

                <Form>
                    <FormGroup>
                        <Label for="idCity">Id</Label>
                        <Input type="text" name="idCity" id="idCity" placeholder="" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="city">City</Label>
                        <Input type="text" name="city" id="cityName" placeholder="" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="country">Country</Label>
                        <Input type="text" name="country" id="countryName" placeholder="" />
                    </FormGroup>
                    <FormGroup>
                        <Label for="selectCountry">Select country</Label>
                        <Input type="select" name="select" id="selectCountry">
                        {this.state.data.map( )}
                        <option>1</option>
                        <option>2</option>
                        <option>3</option>
                        <option>4</option>
                        <option>5</option>
                        </Input>
                    </FormGroup>
                    <Button>Anadir ciudad</Button>
                    <br></br>
                    <Button>Modificar ciudad</Button>
                    <br></br>
                    <Button>Eliminar ciudad</Button>
                    </Form> 
                <Footer/>
            </div>
        )
    }
}

export default cityOptions;
